function sum_area(r1) {
    return (r1[2] - r1[0]) * (r1[3] - r1[1]);
}

function rect_inside_another(r1, r2) {
    return r1[0] >= r2[0] && r1[1] >= r2[1] && r1[2] <= r2[2] && r1[3] <= r2[3];
}

function are_intersected(r1, r2) {
    let inter_x0 = r1[0] > r2[0] ? r1[0] : r2[0];
    let inter_y0 = r1[1] > r2[1] ? r1[1] : r2[1];
    let inter_x1 = r1[2] < r2[2] ? r1[2] : r2[2];
    let inter_y1 = r1[3] < r2[3] ? r1[3] : r2[3];
    return ((inter_x1 - inter_x0 > 0) && (inter_y1 - inter_y0 > 0));
}

function intersections(recs_list,r2) {
    let intersection_list = []
    for (let k=0; k<recs_list.length; k++) {
        let r1 = recs_list[k];
        let inter_x0 = r1[0] > r2[0] ? r1[0] : r2[0];
        let inter_y0 = r1[1] > r2[1] ? r1[1] : r2[1];
        let inter_x1 = r1[2] < r2[2] ? r1[2] : r2[2];
        let inter_y1 = r1[3] < r2[3] ? r1[3] : r2[3];
        if ((inter_x1 - inter_x0 > 0) && (inter_y1 - inter_y0 > 0)) 
            intersection_list.push([inter_x0, inter_y0, inter_x1, inter_y1]);
    }
    return intersection_list;
}

function sub_rectangles(intersections_list, rectangle) { 
    if (intersections_list.length == 0) 
        return [rectangle];
    
    let intersection = intersections_list[0];
    
    if (rect_inside_another(rectangle,intersection)) 
        return [];

    let sub_rectangles_list = [];
    if (!are_intersected(rectangle,intersection))
        sub_rectangles_list.push(rectangle);
    else {
        //  Generamos los subrectangulos
        let rec_a = [rectangle[0],      intersection[1],    intersection[0],    rectangle[3]];
        let rec_b = [intersection[0],   intersection[3],    rectangle[2],       rectangle[3]];
        let rec_c = [rectangle[0],      rectangle[1],       intersection[2],    intersection[1]];
        let rec_d = [intersection[2],   rectangle[1],       rectangle[2],       intersection[3]];
        //  Guardamos los subrectangulos en la lista 
        if (rec_a[2]-rec_a[0] > 0 && rec_a[3] - rec_a[1] > 0)
            sub_rectangles_list.push(rec_a);
        if (rec_b[2]-rec_b[0] > 0 && rec_b[3] - rec_b[1] > 0)
            sub_rectangles_list.push(rec_b);
        if (rec_c[2]-rec_c[0] > 0 && rec_c[3] - rec_c[1] > 0)
            sub_rectangles_list.push(rec_c);
        if (rec_d[2]-rec_d[0] > 0 && rec_d[3] - rec_d[1] > 0)
            sub_rectangles_list.push(rec_d);
        
        if (sub_rectangles_list.length == 0)
            sub_rectangles_list.push(rectangle);
    }
    
    let ret_list = [];
    let last_intersections = intersections_list.slice(1,intersections_list.length);
    for (let k=0; k<sub_rectangles_list.length; k++) {
        let sr_list = sub_rectangles(last_intersections,sub_rectangles_list[k]);
        for (let kk=0; kk<sr_list.length; kk++)
            ret_list.push(sr_list[kk]);
    }
    return ret_list;
}

function calculate(recs) {
    if (recs.length == 0) return 0;
    let sum_recs = 0;
    let dissected_rectangles_list = [];
    /*
        let recs_str = JSON.stringify(recs);
        console.log(recs_str);
    */
    for (let k=0; k<recs.length; k++) {
        let intersections_list = intersections(dissected_rectangles_list,recs[k]);
        //  Filtrar intersections
        let sub_rectangles_list = sub_rectangles(intersections_list,recs[k]);
        for (let kk=0; kk<sub_rectangles_list.length; kk++) {
            sum_recs += sum_area(sub_rectangles_list[kk]);
            dissected_rectangles_list.push(sub_rectangles_list[kk]);
        }
    }
    return sum_recs;
}  

